Embarrassing Fat Bodies

Health-Medical Documentary hosted by Christian Jessen, published by Channel 4 in 2013 - English narration


Information
------------------------------

Embarrassing Fat Bodies
The doctors catch up with some memorable cases. Dr Christian continues the story of Patience, a woman whose excessive eating left her with a huge hernia, as well as a massive growth on her leg the weight of a small child. Dr Dawn catches up with 35-year-old, 40 stone Mike, to see if surgery has curbed his 6,000 calorie-a-day diet. Dr Pixie sees if 33 stone Sara, a woman who was so large she wheeled round her kitchen on an office chair, is back on her feet for good. In the pop up clinic Dr Dawn meets a woman whose unusual fatty lump meets a grisly end with a state-of-the-art technique. Dr Pixie joins a fat fighting boot camp and Dr Christian dons a three stone fat suit to discover the pressures our bodies are under when we pile on the pounds.

